import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './SalaryTable.css';

const SalaryTable = ({ contractId, month, year }) => {
  const [salaries, setSalaries] = useState([]);

  useEffect(() => {
    const fetchSalaries = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/salaries', {
          params: { contractId, month, year }
        });
        setSalaries(response.data);
      } catch (error) {
        console.error('Error fetching salaries:', error);
      }
    };

    fetchSalaries();
  }, [contractId, month, year]);

  const calculateTotal = (key) => {
    return salaries.reduce((total, salary) => total + salary[key], 0);
  };

  return (
    <div className="salary-table">
      <h2>Salary Details</h2>
      <table>
        <thead>
          <tr>
            <th>Employee Name</th>
            <th>Employee EPF (12%)</th>
            <th>Employee ESIC (0.75%)</th>
            <th>P Tax</th>
            <th>Total Deductions</th>
            <th>Net Salary</th>
            <th>Employer EPF (12%)</th>
            <th>ELDI(0.5%)</th>
            <th>Admin Charges (0.5%)</th>
            <th>Employer ESIC (3.25%)</th>
          </tr>
        </thead>
        <tbody>
          {salaries.map((salary, index) => (
            <tr key={index}>
              <td>{salary.employeeName}</td>
              <td>{salary.employeeEPF.toFixed(2)}</td>
              <td>{salary.employeeESIC.toFixed(2)}</td>
              <td>{salary.pTax.toFixed(2)}</td>
              <td>{salary.totalDeductions.toFixed(2)}</td>
              <td>{salary.netSalary.toFixed(2)}</td>
              <td>{salary.employerEPF.toFixed(2)}</td>
              <td>{salary.contribution.toFixed(2)}</td>
              <td>{salary.adminCharges.toFixed(2)}</td>
              <td>{salary.employerESIC.toFixed(2)}</td>
            </tr>
          ))}
          <tr>
            <td><strong>Total</strong></td>
            <td>{calculateTotal('employeeEPF').toFixed(2)}</td>
            <td>{calculateTotal('employeeESIC').toFixed(2)}</td>
            <td>{calculateTotal('pTax').toFixed(2)}</td>
            <td>{calculateTotal('totalDeductions').toFixed(2)}</td>
            <td>{calculateTotal('netSalary').toFixed(2)}</td>
            <td>{calculateTotal('employerEPF').toFixed(2)}</td>
            <td>{calculateTotal('contribution').toFixed(2)}</td>
            <td>{calculateTotal('adminCharges').toFixed(2)}</td>
            <td>{calculateTotal('employerESIC').toFixed(2)}</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default SalaryTable;
